INSERT INTO `items` VALUES (1,'Zuni offering bowl','pottery',NULL,'','see following item for a full description.',45,1,1,'2010-07-04 19:17:04','2011-02-22 01:16:16','DSC03561.JPG','image/jpeg',1850212,'2010-08-18 01:48:22',1,2,1),(2,'Zuni offering bowl','pottery',NULL,'approx 4\"x 3\"','This is a handmade offering bowl. It was made using the \"coil\" method and given it\'s smooth finish by polishing with a rounded river rock. The fine parallel lines represent failing rain, which nurture the growing seedling seen unfurling. The fine lines are painted using a single piece of yucca grass. The dappled terra cotta paint was applied and allowed to be spattered by a rain shower. This type of offering bowl is used by the Zuni during prayers for life giving rain. This is a unique one of a kind piece of artwork.',49,1,1,'2010-07-09 23:48:52','2010-12-15 04:40:08','DSC03560.JPG','image/jpeg',1948471,'2010-08-18 02:01:01',1,2,1),(3,'Fetish necklace with Zuni Bears','necklace',NULL,'25 inches','The Bear is a symbol of protection and good health. When a fetish necklace is worn it is done in the hope that the representative animals\' spirit will imbue the wearer with positive energies.\r\nThe Bears are carved from black jet. Black being the colour of our ancestors. The inlaid turquoise heart lines represent a long life. The necklace is strung with red coral hei\'shi beads and turquoise nuggets. Turquoise is considered a stone of heavens\' blessing and red represents the human spirit.                                                                                            This necklace is a powerful symbol, wear it in good health.',99,1,1,'2010-07-10 03:52:19','2011-01-11 04:26:12','DSC02230.JPG','image/jpeg',123305,'2010-08-18 02:13:09',1,2,1),(4,'kachina doll','katchina',1,'20\'','This Navajo Katchina represents the Hopi Morning Star Singer. It is hand-carved and hand-painted. This is a large carving at over 20\" tall, and is perfectly balanced, standing on one foot, you can almost feel the drum beat and see the morning dance in motion.\r\nThe Morning Star is the last star seen in the dawns\' early light, every morning it is greeted as a sign that the Creator blesses us with a New Day. His arm bands, sash and kilt are hand-painted buckskin, The feathers used are from a pheasant, who is often seen in the predawn light and who\'s calling is said to be prayers asking for a beautiful new day. A Morning Star Singer tries to imitate that beautiful bird call in his song.',200,1,1,'2010-07-19 16:00:19','2011-02-23 06:32:37','DSC02218.JPG','image/jpeg',122266,'2010-08-18 02:12:32',1,2,1),(5,'claw necklace','necklace',NULL,'pendant 5\'\'. necklace 22\"','This pendant representing the Claw of a Grizzly Bear was hand-carved from Buffalo Horn and capped with Sterling Silver, which is inlaid with turquoise, opal and black onyx. It is strung on a necklace of he\' shi\' beads made of turquoise and spaced with polished white coral and black onyx beads. \r\nThe Bear is a powerful symbol of Great Health to the Lakota. Because it is illegal to own true bear claws in most states, we use the horn of the Buffalo, another powerful symbol to the Lakota.',75,1,1,'2010-08-19 04:59:22','2011-02-23 06:32:37','DSC02760.JPG','image/jpeg',1809595,'2010-08-19 04:59:17',1,2,1),(6,'Fossil Shell Necklace','necklace',NULL,'pendant 1.5\". necklace 20\"','The pendant is that of a fossilized Ammonite dug from the Badlands of South Dakota, and is dated to over 125 million years ago. It is setting in Sterling Silver and polished to a rich earth-tone brown. The necklace is made-up of hand-stamped Sterling beads, Tigers Eye Beads and petite Sleeping Beauty Turquoise Beads.\r\nThe Lakota who often find fossilized shells in the soil of the Badlands believe these shells are Gifts from their Ancestors.',75,1,1,'2010-08-19 06:56:07','2011-02-23 06:32:37','DSC02722.JPG','image/jpeg',1971757,'2010-08-19 06:56:01',1,2,1),(7,'Mastadon Ivory Necklace','necklace',NULL,'pendant 1.5\". necklace 20\"','This pendant is Hand-Carved by the Native Alaskans, it is made from the Tusk of Mastadon which died over 14,000 years. The Ivory was carved using Traditional tools and represents the Motherly Love Arctic Geese show to the care of their young. It is surrounded in a bezel of Sterling Silver. The small button-shaped beads are carved from the leg bones of the same Mastadon. The Native Alaskans strongly respect the love and care they observe with the wildlife in their environment.',150,1,1,'2010-08-19 06:59:40','2011-01-11 06:42:30','DSC02729.JPG','image/jpeg',1706201,'2010-08-19 06:59:35',1,2,1),(8,'lakota jewelry','necklace',NULL,'','Short description of product',50,0,0,'2010-08-19 07:02:51','2011-02-22 23:16:10','DSC02733.JPG','image/jpeg',2027974,'2010-08-19 07:02:47',1,2,1),(9,'Artifact','Artifact',NULL,'3\" tall by 5\"long','The  Bear is a powerful symbol of Great Health to the Native Americans. He is respected for his great strength and the female bear is highly admired for the care she shows to her young cubs. It is said a Lakota Mother will protect her children with the same determination as a Mother Bear protects her offspring.\r\nThis large fetish carving is from the Zuni People of New Mexico. It is carved from a block of Citrine Quartz, the teeth are carved from fine white agate and the nose from Black Onyx and the eyes are from Blue Agate Crystals.\r\nIt is believed that if you \"Feed\" a fetish, that you gain the Fetish Animals\' Strengths.\r\nThis Bear can also sit on it\'s back legs as well as stand on all fours',50,0,1,'2010-08-19 07:05:47','2011-01-11 07:07:29','DSC03541.JPG','image/jpeg',1756627,'2010-08-19 07:05:41',1,2,1),(10,'C Pot','generic',NULL,'','',50,0,0,'2010-08-19 07:09:35','2011-02-23 06:32:37','DSC03580_2.JPG','image/jpeg',1786327,'2010-08-19 07:09:30',2,2,1),(11,'Zuni Bear in Jet','Artifact',NULL,'3\" by 5.5\"','This stubby, chubby bear is full of charm. Hand-Carved from a single piece of Fossilized Jet. The Zuni regard the Bear as a sign of Great Health and the sighting of a bear as a gift from the Creator. He comes straight from the Zuni Reservation in New Mexico.',50,0,1,'2010-08-19 07:12:19','2011-01-11 22:18:08','DSC03547.JPG','image/jpeg',2177497,'2010-08-19 07:12:11',1,2,1),(12,'Mud head Katchina','Katchina',NULL,'3\"wide by 4.5\" tall','The Mudheads are the clowns of the Hopi Katchina Pantheon, They remind us to never to take ourselves to seriously and laughter makes use feel better. The Mudheads also teach us that always playing the \"Fool\" can prevent us from accomplishing our daily chores, there is always a time for laughter and a time for work. \r\nThis Katchina is Handcarved from Cottonwood, he is Hand-painted, his kilt and boots are made of Buckskin and his collar is white rabbit skin. \r\nPlace him on a shelf and he\'ll be there to remind you that a Simple Smile can change your Whole Day.',25,1,0,'2010-08-19 07:16:58','2011-01-11 22:35:19','DSC03660.JPG','image/jpeg',1475003,'2010-08-19 07:16:54',1,2,3),(13,'Amber necklace','necklace',NULL,'20\" by 5\" wide','Set in Sterling Silver, This necklace is that of a Butterfly, a Sign of Lifes\' Renewal. The beads are all a rich Honey Amber and spaced with Beads of Sleeping Beauty Turquoise. The wings are made of Rich Coloured Honey Amber. The Butterflies Head is a large piece of Sleeping Beauty Turquoise, and the body is of Butterscotch Amber. This is a Navajo made piece',75,0,1,'2010-08-19 07:20:11','2011-01-11 22:43:38','DSC03734.JPG','image/jpeg',1994110,'2010-08-19 07:20:07',1,2,1),(14,'Mouse Katchina','generic',NULL,'','',50,0,0,'2010-08-19 07:23:35','2011-02-23 06:32:37','DSC03682.JPG','image/jpeg',1620441,'2010-08-19 07:23:31',1,2,1),(15,'Badger Katchina','Katchina',NULL,'','',500,0,0,'2010-08-19 07:26:41','2011-02-23 06:32:37','DSC03668.JPG','image/jpeg',1561884,'2010-08-19 07:26:37',1,2,1),(16,'Rhodachrosite Necklace','necklace',NULL,'','Short description',50,0,0,'2010-08-19 07:29:41','2011-02-23 06:32:37','DSC03725.JPG','image/jpeg',1813429,'2010-08-19 07:29:36',1,2,1),(17,'Horse Pipe','generic',NULL,'','',50,0,0,'2010-08-19 07:32:23','2011-02-23 06:32:37','DSC03698.JPG','image/jpeg',2129774,'2010-08-19 07:32:20',1,2,1),(18,'necklace','necklace',NULL,'','description',50,1,0,'2010-08-19 07:52:07','2011-02-23 06:32:37','DSC02746.JPG','image/jpeg',2010714,'2010-08-19 07:52:02',1,2,1),(19,'turquoise steer skull','artifact',NULL,'','',50,1,0,'2010-08-19 07:55:03','2011-02-23 06:32:37','DSC02990.JPG','image/jpeg',1855306,'2010-08-19 07:54:58',1,2,1),(20,'Lakota warrior hair shirt','Artifact',0,'72\" by 40\'','This Lakota Hair Shirt is from the 1890\'s. It was restored about 25 years ago, at which time the sinews which was used to stitch the garment together were replaced and some of the horsehair was replaced. The Red Heart Beads are original Trade Beads. The Lakota believe themselves descended from the heavens and call themselves the Star People.This is one reason the Lakota do not believe in Burial of the Dead, but place the Departed on scaffolds so the Soul can return to the Heavens. This shirt was created so the wearer could call upon The Stars in Heaven could protect him in Battle and make him immune to Death. When riding a War Pony the fringe and horsehair would give the illusion of the War Shirt Wearer flying through the Air. The Shadow of the Eagle is a reminder that the Creator sends the Winged Ones to watch over us.\r\nThis shirt makes a great wall hanging and will add protection to the Home.',400,0,1,'2010-08-19 07:58:22','2011-01-11 23:33:40','DSC03202.JPG','image/jpeg',2187282,'2010-08-19 07:58:17',1,2,1),(21,'sterling buckle','buckle',NULL,'','',50,1,0,'2010-08-19 08:01:37','2011-02-23 06:32:37','DSC03213.JPG','image/jpeg',2501092,'2010-08-19 08:01:31',1,2,1),(22,'Sterling turquoise claw bracelet','Antique bracelet',NULL,'Fits a mans\' wrist, Approx 8-9\"','This item can only be shipped to States where the Sale of Bear Claw items is Legal.(Please check with your Local and State Laws.)\r\nThis Bracelet is Heavy Weight Sterling Silver and Embellished with Hand-stamped feathers and beads. It has 5 Grizzly Bear Claws, arranged as a Bears Paw. There is a large 2.5 x 2.5 Carrico Lake Turquoise Oval Stone set on the top. This is a signed Navajo Piece from the late 1940\'s.\r\nIt is believed that when we come upon the paw print of a bear we are being a gift from the Creator. This Bear Claw  Bracelet reminds of those blessings.',650,0,1,'2010-08-19 08:06:34','2011-01-12 00:11:02','DSC03218.JPG','image/jpeg',2150149,'2010-08-19 08:06:26',1,2,1),(23,'Carved citrine bear','Artifact',NULL,'','',50,1,0,'2010-08-19 08:09:16','2011-02-23 06:32:37','DSC03544.JPG','image/jpeg',1701652,'2010-08-19 08:09:11',1,2,1),(24,'Handmade painted pot','Pottery',NULL,'','',50,1,0,'2010-08-19 08:12:42','2011-02-23 06:32:37','DSC03571.JPG','image/jpeg',2154006,'2010-08-19 08:12:37',1,2,1),(25,'Turquoise and Jaspernecklace','necklace',NULL,'','short description',50,1,0,'2010-08-19 08:16:58','2011-02-23 06:32:37','DSC03724.JPG','image/jpeg',2071128,'2010-08-19 08:16:54',1,2,1),(26,'Longhair Zuni Katchina','Katchina',NULL,'','',50,1,0,'2010-08-20 04:12:00','2011-02-23 06:32:37','DSC03675.JPG','image/jpeg',2087127,'2010-08-20 04:11:53',1,2,1),(27,'Sterling inlay Zuni belt buckle','belt buckle',NULL,'','',50,1,0,'2010-08-20 04:15:28','2011-02-23 06:32:37','DSC03214.JPG','image/jpeg',2282116,'2010-08-20 04:15:25',1,2,1),(28,'Longhair Zuni Katchina','Katchina',NULL,'','',50,1,0,'2010-08-20 04:21:34','2011-02-23 06:32:37','DSC03676.JPG','image/jpeg',1692647,'2010-08-20 04:21:30',1,2,1),(29,'longhair Zuni Katchina','katchina',NULL,'','',50,1,0,'2010-08-20 04:27:40','2011-02-23 06:32:37','DSC03678.JPG','image/jpeg',1781783,'2010-08-20 04:27:35',1,2,1),(30,'Katchina Hopi eagle dancer','katchina',NULL,'','',50,1,0,'2010-08-20 04:32:09','2011-02-23 06:32:37','DSC03681.JPG','image/jpeg',1731729,'2010-08-20 04:32:02',1,2,1),(31,'Katchina Hopi sun face','Katchina',NULL,'','',50,1,0,'2