INSERT INTO `pages` VALUES (1,'home','home','<h1>Lakota Spirit</h1>\r\n<p><span class=\"text\">The Lakota are a spiritual and free spirited people  living on the Central Plains of The United States. LAKOTA SPIRIT brings  to you the very best of Native American artistic expression and helps  capture that sense of freedom for your own unique style.</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>',1,'2010-07-10 01:13:45','2010-09-26 04:22:43',0),(3,'contact','Contact Us','<h3 style=\"text-align: center;\"><span style=\"font-size: small;\">Mark \"Wolf\" Faulkins</span></h3>\r\n<p style=\"text-align: center;\"><span style=\"font-size: medium;\">415-531-5642</span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: x-large;\"><a title=\"email\" href=\"http://scr.im/shunkaska\" target=\"_blank\">Email Wolf</a></span></p>',4,'2010-07-10 03:19:04','2010-08-19 02:43:31',0),(4,'about','About Us','Here it page about Lakota Spirit Jewelry ',5,'2010-07-10 03:19:44','2010-07-10 03:19:44',0);
